import React from "react";
import { Input } from "@chakra-ui/core";
export const Exercise = () => {
    const letter = "a";
    return (
        <div>
            Try this first Exercise: <br />
            <Input size="lg" placeholder={letter} w="3rem" onKeyDown={this.add} />
        </div>
    )
}
